const styles = {

    button: {
        backgroundColor: '#ff007f',
        height: 60,
        flexDirection: 'row',
        borderRadius: 50,
        overflow: 'hidden',
        alignItems: 'center',
        marginTop: 8,
    },

    buttonText: {
        flex: 1,
        justifyContent: 'center',
        textAlign: 'center',
        color: '#FFF',
        fontFamily: 'Roboto_500Medium',
        fontSize: 16,
    },

    container: {
        flex: 1,
        padding: 32,
        backgroundColor: '#E0FFFF'
    },

    footer: {
        marginTop: 200
    },

    hyperlinkStyle: {
        color: 'blue',
    },

    input: {
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginBottom: 8,
        paddingHorizontal: 24,
        fontSize: 16,
    },

    main: {
        flex: 1,
        justifyContent: 'center'
    },

    select: {},

    title: {
        color: '#322153',
        fontSize: 15,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 360,
        marginTop: 25,
        textAlign: 'center'
    },
}

export default styles;
